import { Link } from "react-router-dom"
import { useParams } from "react-router-dom"

export default function Herramientas(props){
    let {id}=useParams();
    let productId = id - 1;
    console.log(productId)
    return(
        <div>
            <h2><b>{props.allproducts[productId].title}</b></h2>
            <img src={props.allproducts[productId].images[0]}></img>
        </div>
    )
}
